import React from 'react';
import { Box, Heading, Text, Button, Flex } from '@chakra-ui/react';
import './style.css';

const CustomPageWithGrid = () => {
  return (
    <Box minH="100vh" py={20} px={8}>
      <Box className="grid-background" >
      <Flex 
        align="center"
        justify="center"
        textAlign={{ base: 'center' }}
      >
        <Box maxW="600px" mr={{ md: 8 }}>
          <Heading align="center" as="h1" size="2xl" mb={4} color="gray.700" lineHeight={1.2}>
            Personalized <span className="highlight">Mentorship</span> & <span className="highlight">Guidance</span> From Industry Experts
          </Heading>
          <Text align="center"  fontSize="xl" color="gray.700" mb={8}>
          Fueling innovation and opportunity by empowering the next generation of diverse tech leaders with mentorship and access to cutting-edge resources and educational opportunities.          </Text>
          <Button align="center" colorScheme="blue" size="lg">
            Registration Closed
          </Button>
        </Box>
      </Flex>
      </Box>
      <Box className='no-background'>
      </Box>
    </Box>
  );
};

export default CustomPageWithGrid;
